import { useEffect } from 'react';

export default function AgeChecker() {


    const person = {
        age: 29
      }
    useEffect(() => {
        let result = "Ok to drink"
        if(person.age < 18) result = "Under 18"
        if(person.age < 21) result = "Under 21"
        return result
    }, [])

}
